        return new Promise((resolve,reject) =>{
                resolve(data)
        })
    }

    useEffect(() => {
    getDatos().then((res)=>{
        setProductos(res);
    });
    },[])

    console.log(productos.length);

    return <div>
        {productos.length > 0 && 

            productos.map((producto) => {

                return (

                    <div>

                        <h2>{producto.first_name}</h2>
                        <h2>{producto.last_name}</h2>
                        <h2>{producto.email}</h2>
                    </div>
                )
            })


        }
    </div>
}
